s.r='<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en"> <head> <meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> <title>Indemnity Form Start&#39;UP 2022</title> <style type="text/css"> * { margin: 0; padding: 0; text-indent: 0; } .s1 { color: black; font-family: Tahoma, sans-serif; font-style: normal; font-weight: bold; text-decoration: none; font-size: 15pt; } p { color: black; font-family: Tahoma, sans-serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 14pt; margin: 0pt; } .s2 { color: #F00; font-family: Tahoma, sans-serif; font-style: normal; font-weight: bold; text-decoration: none; font-size: 14pt; } h2 { color: black; font-family: Tahoma, sans-serif; font-style: normal; font-weight: bold; text-decoration: none; font-size: 14pt; } h1 { color: black; font-family: Tahoma, sans-serif; font-style: normal; font-weight: bold; text-decoration: underline; font-size: 15pt; } li { display: block; } #l1 { padding-left: 0pt; } #l1>li>*:first-child:before { content: "\u25cf "; color: black; font-family: Arial, sans-serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 14pt; } li { display: block; } #l2 { padding-left: 0pt; } #l2>li>*:first-child:before { content: "\u2022 "; color: black; font-family: Tahoma, sans-serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 14pt; } </style> </head> <body><center> <h1> Indemnity Form </h1></center><br> <p style="text-indent: 0pt;text-align: left;"><br /></p> <p style="padding-top: 11pt;padding-left: 5pt;text-indent: 1pt;text-align: justify;">I am <span class="s2">'+s.gf5().c+' </span>,from LC <span class="s2">'+s.gf5().f+'</span><b>. </b>I shall attend <b>Start&#39;UP 2022</b>, hosted by LC <b>NABEL</b>, as a delegate which will take place from the 16th of September 2022 until the 18th of September 2022 in Caribbean World Hammamet Village in Nabeul. </p> <p style="padding-left: 5pt;text-indent: 3pt;text-align: justify;">As a delegate of the Conference, I hereby confirm that I shall act responsibly at all times during the conference and not harm the reputation or brand of AIESEC. </p> <ul id="l1"> <li data-list-text="\u25cf"> <p style="padding-left: 41pt;text-indent: -17pt;text-align: left;">I will comply with all applicable rules and regulations and other reasonable directions given by AIESEC or others.</p> </li> <li data-list-text="\u25cf"> <p style="padding-left: 42pt;text-indent: -18pt;text-align: left;">In case anything is broken at the room, reception or bar \u2026 the concerned LC will be responsible to pay the damages.</p> </li> <li data-list-text="\u25cf"> <p style="padding-left: 41pt;text-indent: -17pt;text-align: justify;">I agree to follow further instructions announced by AIESEC or the hotel security staff regarding my presence in the hotel and the safety of my stay.</p> </li> <li data-list-text="\u25cf"> <p style="padding-left: 41pt;text-indent: -17pt;text-align: justify;">I hereby declare that if, during the period specified above, any of my actions directly or indirectly cause any kind of damage, injury to an individual or if I participate in any illegal activities, I shall be personally responsible and liable for such actions and consequences.</p> </li> <li data-list-text="\u25cf"> <p style="padding-left: 41pt;text-indent: -17pt;text-align: justify;">I <b>ASSUME FULL RESPONSIBILITY </b>for understanding and following the rules and security practices associated with <b>Start&#39;UP 2022 </b>and for my personal safety.</p> </li> <li data-list-text="\u25cf"> <p style="padding-left: 41pt;text-indent: -18pt;text-align: justify;">I will not bring any alcoholic substances nor any drug of any kind.</p> </li> <li data-list-text="\u25cf"> <p style="padding-top: 5pt;padding-left: 41pt;text-indent: -16pt;text-align: left;">I am aware of the <b>Covid-19 </b>situation in our country and I will respect the health safety protocols. </p> </li> <li data-list-text="\u25cf"> <p style="padding-left: 41pt;text-indent: -18pt;text-align: left;">In case I am suspecting myself to be covid+, I am aware that I will be the one paying the fees to have the covid-19 test.</p> </li> </ul> <h1 style="padding-top: 14pt;text-indent: 0pt;text-align: center;">SAFETY PROTOCOL</h1> <p style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">The resumption of our activities is important for us as members of AIESEC, not only the exchange programs, but also the national conferences. Of course, this recovery must necessarily be done while respecting sanitary measures.</p> <p style="padding-left: 5pt;text-indent: 0pt;text-align: justify;">For this, the Organizing Committee has developed a safety protocol to help and guide the delegates, to be present at <b>Start&#39;UP </b>while ensuring the protection of their health.</p> <p style="padding-left: 5pt;text-indent: 0pt;text-align: justify;">Therefore, I agree to comply to the following COVID-19 safety protocol:</p> <ul id="l2"> <li data-list-text="\u2022"> <p style="padding-top: 4pt;padding-left: 38pt;text-indent: -10pt;text-align: left;">Wearing a face mask through the whole conference.</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 35pt;text-indent: -10pt;line-height: 17pt;text-align: left;">Not smoking inside the hotel (reception).</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 24pt;text-indent: 0pt;text-align: left;">Using hand sanitizers when touching buttons, doorknobs, handrails, chairs, tables, screens, projectors, telephones, boards, and markers.</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 35pt;text-indent: -10pt;line-height: 17pt;text-align: left;">Avoiding group gatherings at break time.</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 35pt;text-indent: -10pt;text-align: left;">Coffee breaks are distributed in open spaces</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 41pt;text-indent: -16pt;text-align: justify;">Delegates who have tested positive for covid-19, or whose family member has tested positive, or who have been identified as a risk contact 5 days or less before the conference, should not attend it. They should inform their LCPs who should inform the OCP.</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 41pt;text-indent: -17pt;text-align: justify;">Each LC will have a specific time to finalize the check-in, if the LC did not respect it, it will be postponed to dinner-time.</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 41pt;text-indent: -16pt;text-align: justify;">Every delegate must show his vaccination certificate before entering the hotel.</p> <p style="text-indent: 0pt;text-align: left;"><br /></p> <p style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Additionally, I hereby agree to avoid the following actions that may endanger my safety and the others&#39; during my stay for the conference:</p> <p style="text-indent: 0pt;text-align: left;"><br /></p> </li> <li data-list-text="\u2022"> <p style="padding-left: 35pt;text-indent: -10pt;text-align: left;">Exchanging materials (pens, paper).</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 35pt;text-indent: -10pt;line-height: 17pt;text-align: left;">Changing my seat during meetings, sessions, lunchtime...</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 35pt;text-indent: -10pt;line-height: 17pt;text-align: left;">Handshaking, hugs, and general skin-to-skin contact.</p> </li> <li data-list-text="\u2022"> <p style="padding-left: 35pt;text-indent: -10pt;text-align: left;">Gatherings outside the plenary.</p> </li> </ul> <p style="text-indent: 0pt;text-align: left;"><br /></p> <p style="padding-left: 5pt;text-indent: 1pt;text-align: left;">Lastly, I agree to accept any additional safety measures taken by the <b>OC TEAM </b>or the hotel and respect them for the safety of everyone.</p> <p style="text-indent: 0pt;text-align: left;"><br /></p> <h2 style="padding-left: 5pt;text-indent: 1pt;text-align: justify;">I understand and agree that if I do not follow the rules and directions, AIESEC may withdraw my right to participate in the conference without having any obligation to refund my delegate fee.</h2> <p style="text-indent: 0pt;text-align: left;"><br /></p> <p style="padding-left: 5pt;text-indent: 1pt;text-align: justify;">I confirm that I have been given adequate time to receive, read through and comprehend the terms and conditions included in this document and accept these risks associated with <b>Start&#39;UP 2022 </b>and that I have executed this agreement voluntarily.</p> <p style="text-indent: 0pt;text-align: left;"><br /></p> <p style="padding-left: 6pt;text-indent: 0pt;text-align: justify;">Date : <strong> '+s.f+' </strong></p> <p style="padding-left: 6pt;text-indent: 0pt;text-align: justify;">Signature of participant :</p> </body> </html>'
